import React from "react";

function Social () {
    return(
        <ul className="list-group">
            <li className="list-groub-item">Facebook</li>
            <li className="list-groub-item">Instagram</li>
            <li className="list-groub-item">Snapchat</li>
        </ul>
    )
}

export default Social ;
